query:
DELETE q1 FROM questions q1 INNER JOIN (
  SELECT questionId, MIN(id) as min_id FROM questions GROUP BY questionId HAVING COUNT(*) > 1
) q2 ON q1.questionId = q2.questionId AND q1.id > q2.min_id;

